<script>

function getParameterByName(name, url) {
    if (!url) url = window.location.href;
    name = name.replace(/[\[\]]/g, "\\$&");
    var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
        results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, " "));
}

$('path').on('click',function(){ 

if (d3.select(this).attr("state_link")!=undefined){
window.open('https://www.google.co.in/search?q='+d3.select(this).attr("state_link").toLowerCase()+' lok sabha');
}
});

var tabulate = function (data,columns) {

  $('#myTable').DataTable().destroy();
  
  d3.selectAll('table').remove();
            
  var table = d3.select('.data_table').append('table')
          .attr("id","myTable")
          .attr("class","table table-bordered");
    var thead = table.append('thead')
   .attr("class","data_head");
    var tbody = table.append('tbody')

    thead.append('tr')
      .selectAll('th')
        .data(columns)
        .enter()
      .append('th')
        .attr("class","dynatable-head")
        .text(function (d) { return d })

    var rows = tbody.selectAll('tr')
        .data(data)
        .enter()
      .append('tr')
    .attr("state_link",function (d) { return  d.constituency })
    
    var cells = rows.selectAll('td')
        .data(function(row) {
            return columns.map(function (column) {
                return { column: column, value: row[column] }
          })
      })
      .enter()
    .append('td')
      .text(function (d) { return d.value })

    $('#myTable').DataTable({ "sScrollX": "100%", "sScrollXInner": "150%"});
  
  return table;

}

function capitalizeFirstLetter(string) {
    return string.charAt(0).toUpperCase() + string.slice(1).toLowerCase();
}
